// Name: Split like Cake
// ID: splitlikecake
// Description: Split text by a certain character.
// By: RBryanYT <https://scratch.mit.edu/users/a_Gameer0438791>
// License: MIT

var split_text = "";

const cake = "data:image/png;base64,"
const cakeSmall = "data:image/png;base64,"

class SplitLikeCake {
  getInfo() {
    return {
      id: 'splitlikecake',
      name: "Split like Cake",
      color1: "#bf803b",
      color2: "#a97134",
      color3: "#97642e",
      menuIconURI: cake,
      blockIconURI: cakeSmall,
      blocks: [
        {
          opcode: 'split',
          blockType: Scratch.BlockType.COMMAND,
          text: 'split [TEXT] by character [CHAR]',
          arguments: {
            TEXT: {
              type: Scratch.ArgumentType.STRING,
              defaultValue: "Hello|World!"
            },
            CHAR: {
              type: Scratch.ArgumentType.STRING,
              defaultValue: "|"
            }
          }
        },
        {
          opcode: 'splitted',
          blockType: Scratch.BlockType.REPORTER,
          text: 'the split cake'
        },
        {
          opcode: 'getindex',
          blockType: Scratch.BlockType.REPORTER,
          text: 'get slice [INDEX] of the split cake',
          arguments: {
            INDEX: {
              type: Scratch.ArgumentType.NUMBER,
              defaultValue: 1
            }
          }
        }
      ],
    };
  }

  split(args) {
    split_text = args.TEXT.split(args.CHAR);
  }
  splitted() {
    return split_text;
  }
  getindex(args) {
    return split_text[args.INDEX-1]
  }
}
Scratch.extensions.register(new SplitLikeCake());
